                                                                  'dbxref_id' => 8756,
                                                                  'is_obsolete' => 0,
                                                                  'cvterm_id' => 2418,
                                                                  'definition' => 'Directed pumping of antibiotic out of a cell to confer resistance. Small multidrug resistance (SMR) proteins are a relatively small family of transporters, restricted to prokaryotic cells. They are also the smallest multidrug transporters, with only four transmembrane alpha-helices and no significant extramembrane domain.',
