                                                                },
                                                                {
                                                                  'is_relationshiptype' => 0,
                                                                  'is_obsolete' => 0,
                                                                  'dbxref_id' => 8779,
                                                                  'cvterm_id' => 2430,
                                                                  'definition' => 'Beta-lactam antibiotics are a broad class of antibiotics that include penams (penicillin derivatives), cephems (cephalosporins), monobactams, and carbapenems. These antibiotic agents contain a beta-lactam nucleus in its molecular structure. They are the most widely-used group of antibiotics.',
                                                                  'name' => 'beta-lactam',
                                                                  'cv_id' => 13
                                                                },
                                                                {
                                                                  'definition' => 'Penams, often referred to as penicillins, are a group of antibiotics derived from Penicillium fungi. Penicillin antibiotics are historically significant because they are the first drugs that were effective against many previously serious diseases such as syphilis and Staphylococcus infections. Penicillins are still widely used today, though many types of bacteria are now resistant. All penicillins are beta-lactam antibiotics in the penam sub-group, and are used in the treatment of bacterial infections caused by susceptible, usually Gram-positive, organisms.',
                                                                  'name' => 'penam',
                                                                  'cv_id' => 13,
