                                                                  'cv_id' => 13,
                                                                  'name' => 'vanA',
                                                                  'definition' => 'VanA is a D-Ala-D-Ala ligase that can synthesize D-Ala-D-Lac, an alternative substrate for peptidoglycan synthesis that reduces vancomycin binding affinity. It has been isolated from VREs. It is associated with both vancomycin and teicoplanin resistance.'
                                                                },
                                                                {
                                                                  'name' => 'vanX',
                                                                  'cv_id' => 13,
                                                                  'definition' => 'VanX is a D,D-dipeptidase that cleaves D-Ala-D-Ala but not D-Ala-D-Lac, ensuring that the latter dipeptide that has reduced binding affinity with vancomycin is used to synthesize peptidoglycan substrate.',
                                                                  'dbxref_id' => 8782,
