                                                                  'cv_id' => 13,
                                                                  'definition' => 'Genes involved in restructuring of the cell wall and thus providing resistance to glycopeptides.'
                                                                },
                                                                {
                                                                  'definition' => 'VanB is a D-Ala-D-Ala ligase similar to VanA, and can synthesize D-Ala-D-Lac, an alternative substrate for peptidoglycan synthesis that reduces vancomycin binding affinity. It has been isolated from VREs. It is associated with vancomycin resistance, but not teicoplanin resistance.',
                                                                  'name' => 'vanB',
                                                                  'cv_id' => 13,
                                                                  'is_relationshiptype' => 0,
                                                                  'is_obsolete' => 0,
                                                                  'dbxref_id' => 8785,
                                                                  'cvterm_id' => 2435
                                                                },
                                                                {
                                                                  'name' => 'TEM beta-lactamase',
                                                                  'cv_id' => 13,
                                                                  'definition' => 'TEM-1 is the most commonly-encountered beta-lactamase in gram-negative bacteria. Up to 90% of ampicillin resistance in E. coli is due to the production of TEM-1. Also responsible for the ampicillin and penicillin resistance that is seen in H. influenzae and N. gonorrhoeae in increasing numbers. Although TEM-type beta-lactamases are most often found in E. coli and K. pneumoniae, they are also found in other species of gram-negative bacteria with increasing frequency. The amino acid substitutions responsible for the ESBL phenotype cluster around the active site of the enzyme and change its configuration, allowing access to oxyimino-beta-lactam substrates. Opening the active site to beta-lactam substrates also typically enhances the susceptibility of the enzyme to b-lactamase inhibitors, such as clavulanic acid.  Although the inhibitor-resistant beta-lactamases are not ESBLs, they are often discussed with ESBLs because they are also derivatives of the classical TEM- or SHV-type enzymes. These enzymes were at first given the designation IRT for inhibitor-resistant TEM beta-lactamase; however, all have subsequently been renamed with numerical TEM designations. There are at least 19 distinct inhibitor-resistant TEM beta-lactamases. Inhibitor-resistant TEM beta-lactamases have been found mainly in clinical isolates of E. coli, but also some strains of K. pneumoniae, Klebsiella oxytoca, P. mirabilis, and Citrobacter freundii. Although the inhibitor-resistant TEM variants are resistant to inhibition by clavulanic acid and sulbactam, thereby showing clinical resistance to the beta-lactam-lactamase inhibitor combinations of amoxicillin-clavulanate (Co-amoxiclav), ticarcillin-clavulanate, and ampicillin/sulbactam, they normally remain susceptible to inhibition by tazobactam and subsequently the combination of piperacillin/tazobactam, although resistance has been described.',
                                                                  'is_obsolete' => 0,
                                                                  'dbxref_id' => 8786,
                                                                  'cvterm_id' => 2436,
                                                                  'is_relationshiptype' => 0
                                                                },
                                                                {
                                                                  'cv_id' => 13,
                                                                  'name' => 'SHV beta-lactamase',
                                                                  'definition' => 'SHV-1 shares 68 percent of its amino acids with TEM-1 and has a similar overall structure. The SHV-1 beta-lactamase is most commonly found in K. pneumoniae and is responsible for up to 20% of the plasmid-mediated ampicillin resistance in this species. ESBLs in this family also have amino acid changes around the active site, most commonly at positions 238 or 238 and 240. More than 60 SHV varieties are known.',
                                                                  'cvterm_id' => 2437,
                                                                  'is_obsolete' => 0,
                                                                  'dbxref_id' => 8787,
                                                                  'is_relationshiptype' => 0
                                                                },
                                                                {
                                                                  'cvterm_id' => 2438,
                                                                  'is_obsolete' => 0,
                                                                  'dbxref_id' => 8788,
                                                                  'is_relationshiptype' => 0,
                                                                  'cv_id' => 13,
                                                                  'name' => 'CTX-M beta-lactamase',
                                                                  'definition' => 'These enzymes were named for their greater activity against cefotaxime than other oxyimino-beta-lactam substrates (eg, ceftazidime, ceftriaxone, or cefepime). Rather than arising by mutation, they represent examples of plasmid acquisition of beta-lactamase genes normally found on the chromosome of Kluyvera species, a group of rarely pathogenic commensal organisms. These enzymes are not very closely related to TEM or SHV beta-lactamases in that they show only approximately 40% identity with these two commonly isolated beta-lactamases. More than 40 CTX-M enzymes are currently known. Despite their name, a few are more active on ceftazidime than cefotaxime.  CTX-M-15 was recently found in bacterial strains expressing NDM-1 and were responsible for resistance to aztreonam.'
                                                                },
                                                                {
                                                                  'cv_id' => 13,
                                                                  'name' => 'OXA beta-lactamase',
                                                                  'definition' => 'OXA beta-lactamases were long recognized as a less common but also plasmid-mediated beta-lactamase variety that could hydrolyze oxacillin and related anti-staphylococcal penicillins. These beta-lactamases differ from the TEM and SHV enzymes in that they belong to molecular class D and functional group 2d. The OXA-type beta-lactamases confer resistance to ampicillin and cephalothin and are characterized by their high hydrolytic activity against oxacillin and cloxacillin and the fact that they are poorly inhibited by clavulanic acid. Amino acid substitutions in OXA enzymes can also give the ESBL phenotype. The OXA beta-lactamase family was originally created as a phenotypic rather than a genotypic group for a few beta-lactamases that had a specific hydrolysis profile. Therefore, there is as little as 20% sequence homology among some of the members of this family. However, recent additions to this family show some degree of homology to one or more of the existing members of the OXA beta-lactamase family. Some confer resistance predominantly to ceftazidime, but OXA-17 confers greater resistance to cefotaxime and cefepime than it does resistance to ceftazidime.',
                                                                  'cvterm_id' => 2439,
                                                                  'is_obsolete' => 0,
                                                                  'dbxref_id' => 8790,
                                                                  'is_relationshiptype' => 0
                                                                },
