                                                                },
                                                                {
                                                                  'definition' => 'AmpC type beta-lactamases are commonly isolated from extended-spectrum cephalosporin-resistant Gram-negative bacteria. AmpC beta-lactamases (also termed class C or group 1) are typically encoded on the chromosome of many Gram-negative bacteria including Citrobacter, Serratia and Enterobacter species where its expression is usually inducible; it may also occur on Escherichia coli but is not usually inducible, although it can be hyperexpressed. AmpC type beta-lactamases may also be carried on plasmids. AmpC beta-lactamases, in contrast to ESBLs, hydrolyse broad and extended-spectrum cephalosporins (cephamycins as well as to oxyimino-beta-lactams) but are not inhibited by beta-lactamase inhibitors such as clavulanic acid.',
