                                                                            'value' => 'On Jun 25, 2008 this sequence version replaced gi:74230569. The Escherichia coli E110019 whole genome shotgun (WGS) project has the project accession AAJW00000000. This version of the project (02) has the accession number AAJW02000000, and consists of sequences AAJW02000001-AAJW02000137. Escherichia coli E110019 was isolated from an outbreak in Finland (Viljanen MK et al, Lancet (1990), 336(8719): 831-4). The outbreak affected approximately 650 students at a school. In a fashion uncommon in other EPEC strains, E. coli E110019 spread from person-to-person to over 100 close contacts outside of the school setting. E. coli E110019 represents an atypical enteropathogenic E. coli (atypical EPEC) characterized by the lack of previously identified EPEC virulence factors including the EAF plasmid. E110019 is serotype O111:H9. ',
