                                                                            'value' => 'On Jul 24, 2008 this sequence version replaced gi:74231009. The Escherichia coli B171 whole genome shotgun (WGS) project has the project accession AAJX00000000. This version of the project (02) has the accession number AAJX02000000, and consists of sequences AAJX02000001-AAJX02000262. Escherichia coli B171 is a member of the enteropathogenic E. coli (EPEC), EPEC2 subgroup. This strain was provided by Dr. James B. Kaper from the University of Maryland School of Medicine and the Center for Vaccine Development. EPEC is an important cause of diarrhea in the developing world. EPEC infection is limited to the small intestine. EPEC adhere to the epithelial surface and secrete effectors into the eukaryotic cell, causing cellular rearrangement such as pedestals and the formation of attaching and effacing lesions. This infection is often self-limiting, but in infants, elderly and immuno- compromised individuals, the infection can result in hemolytic uremic syndrome (HUS) or hemorrhagic colitis (HC). Other virulence factors of E. coli B171 include O111:NM, bundle forming pilus encoding plasmid EAF (GenBank Accession Number AB024946) and the LEE pathogenicity island. ',
