                                                                            'value' => 'The Escherichia coli MS 45-1 whole genome shotgun (WGS) project has the project accession ADTO00000000. This version of the project (01) has the accession number ADTO01000000, and consists of sequences ADTO01000001-ADTO01000396. Escherichia coli 45-1 (No 16S rRNA gene available) is a member of the Proteobacteria division of the domain bacteria and has been isolated from the gut. This is a reference genome for the Human Microbiome Project. This project is co-owned with the Human Microbiome project DACC. Bacteria provided by Edgar C. Boedeker, MD (Division of Gastroenterology, Department of Internal Medicine, 1 University of New Mexico, MSC10-5550, Albuquerque, NM 87131, USA), funded by the NIAID Enteric Pathogens Research Unit at the University of Maryland,Baltimore (EPRU; contract no. NO1-AI-30055). Source DNA provided by Phillip I. Tarr, MD (Division of Gastroenterology and Nutrition, Department of Pediatrics, Washington University School of Medicine, Campus Box 8208, 660 S. Euclid, St. Louis, MO 63110, USA), funded by \'Effect of Crohn\'s Disease Risk Alleles on Enteric Microbiota\' (UH2 DK083994 to Ellen Li, MD, PhD (Division of Gastroenterology, Washington University School of Medicine, Campus Box 8124, 660 S. Euclid, St. Louis, MO 63110, USA)). Coding sequences were predicted using GeneMark v3.3 and Glimmer2 v2.13. Intergenic regions not spanned by GeneMark and Glimmer2 were blasted against NCBI\'s non-redundant (NR) database and predictions generated based on protein alignments. tRNA genes were determined using tRNAscan-SE 1.23 and non-coding RNA genes by RNAmmer-1.2 and Rfam v8.0. Gene names are generated at the contig level and may not necessarily reflect any known order or orientation between contigs. The National Human Genome Research Institute (NHGRI), National Institutes of Health (NIH) Demonstration Project - \'Effect of Crohn\'s Disease Risk Alleles on Enteric Microbiota\' is funding the sequence characterization of the Escherichia coli 45-1 genome. Annotation was added to the contigs in July 2010. Product names were updated in June 2013. ##Genome-Assembly-Data-START## Finishing Goal :: High-Quality Draft Current Finishing Status :: High-Quality Draft Assembly Method :: Velvet v. 0.7.57 Genome Coverage :: 60.6x Sequencing Technology :: Illumina ##Genome-Assembly-Data-END## ',
