                                                                                           'value' => 'The Escherichia coli MS 79-10 whole genome shotgun (WGS) project has the project accession ADWR00000000. This version of the project (01) has the accession number ADWR01000000, and consists of sequences ADWR01000001-ADWR01000157. Escherichia coli 79-10 (No 16S rRNA gene available) is a member of the Proteobacteria division of the domain bacteria and has been isolated from the gut. This is a reference genome for the Human Microbiome Project. This project is co-owned with the Human Microbiome Project DACC. Bacteria provided by Edgar C. Boedeker, MD (Division of Gastroenterology, Department of Internal Medicine, 1 University of New Mexico, MSC10-5550, Albuquerque, NM 87131, USA). Funded by the NIAID Enteric Pathogens Research Unit at the University of Maryland, Baltimore (EPRU; contract no. NO1-AI-30055). Source DNA provided by Phillip I. Tarr, MD (Division of Gastroenterology and Nutrition, Department of Pediatrics, Washington University School of Medicine, Campus Box 8208, 660 S. Euclid, St. Louis, MO 63110, USA). Funded by \'Effect of Crohn\'s Disease Risk Alleles on Enteric Microbiota\' (UH2 DK083994 to Ellen Li, MD, PhD (Division of Gastroenterology, Washington University School of Medicine, Campus Box 8124, 660 S. Euclid, St. Louis, MO 63110, USA)). Coding sequences were predicted using GeneMark v3.3 and Glimmer2 v2.13. Intergenic regions not spanned by GeneMark and Glimmer2 were blasted against NCBI\'s non-redundant (NR) database and predictions generated based on protein alignments. tRNA genes were determined using tRNAscan-SE 1.23 and non-coding RNA genes by RNAmmer-1.2 and Rfam v8.0. Gene names are generated at the contig level and may not necessarily reflect any known order or orientation between contigs.2 coding regions are completely contained in another coding region on the same strand. Annotation was added to the contigs in August 2011. The locus_tag prefix was corrected in August 2013, from HMPREF9439 to HMPREF9349. ##Genome-Assembly-Data-START## Finishing Goal :: Improved High-Quality Draft Current Finishing Status :: Improved High-Quality Draft Assembly Method :: Velvet v. 2.1-PreRelease-4/28/2009 Genome Coverage :: 11x Sequencing Technology :: 454 ##Genome-Assembly-Data-END## ',
